import { Provider } from "react-redux";
import store from "./store";
import HeaderComponent from "./compenents/default/headerComponent";
import ContentComponent from "./compenents/contents/main/contentComponent";
import FooterComponent from "./compenents/default/footerComponent";
import BaseComponent from "./compenents/baseComponent";

function App() {
  return (
    <Provider store={store}>
      <BaseComponent 
        header={HeaderComponent}
        content={ContentComponent}
        footer={FooterComponent}
      />
    </Provider>
  );
}

export default App;
